import React, { Component } from 'react'

export default class Cue extends Component {
    constructor(props) {
        super(props);
        this.state = {
            count: 0,
            visualCues: this.props.visualCues
        }
    }

    incrementCount() {
            setInterval(() => {
                return this.state.count < 100 ? this.setState({count: this.state.count + 10}) : null;
            }, 1000)
    }

    componentDidMount() {
        this.incrementCount();
    }

    render() {
        console.log('this.state.count = ', `${this.state.count}%`)
        return (
            <div className="column has-text-centered">
                <br/>
                <progress className="progress is-warning" value="75" max="100">75%</progress>
                <progress className="progress is-danger" value={`${this.state.count}`} max="100">{`${this.state.count}%`}</progress>
            </div>
        )
    }
}
